    <!DOCTYPE html><html><head><meta charset="UTF-8"><meta http-equiv="X-UA-Compatible" content="IE=edge"><meta name="viewport" content="width=device-width,initial-scale=1"><link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/video.js@7.5.0/dist/video-js.min.css"><title>Dash</title><style>body{background:#000;padding:0;margin:0}#preloader{overflow:hidden;background-image:linear-gradient(145deg,#9c05ad 0,#6704c8 100%);left:0;right:0;top:0;bottom:0;position:fixed;z-index:99999;color:#fff}#preloader .jumper{left:0;top:0;right:0;bottom:0;display:block;position:absolute;margin:auto;width:80px;height:80px}#preloader .jumper>div{background-color:#fff;width:10px;height:10px;border-radius:100%;-webkit-animation-fill-mode:both;animation-fill-mode:both;position:absolute;opacity:0;width:80px;height:80px;-webkit-animation:jumper 1s 0s linear infinite;animation:jumper 1s 0s linear infinite}#preloader .jumper>div:nth-child(2){-webkit-animation-delay:.33333s;animation-delay:.33333s}#preloader .jumper>div:nth-child(3){-webkit-animation-delay:.66666s;animation-delay:.66666s}@-webkit-keyframes jumper{0%{opacity:0;-webkit-transform:scale(0);transform:scale(0)}5%{opacity:1}100%{-webkit-transform:scale(1);transform:scale(1);opacity:0}}@keyframes jumper{0%{opacity:0;-webkit-transform:scale(0);transform:scale(0)}5%{opacity:1}100%{opacity:0}}</style></head><body id="body_id"  style="white-space:nowrap;overflow:hidden"><!-- ***** Preloader Start ***** --><div id="preloader"><div class="jumper"><div></div><div></div><div></div></div></div><!-- ***** Preloader End ***** --><div id="wap" style="overflow:hidden"><video id="example-video" class="video-js vjs-default-skin" controls width="320" height="240"></video></div><script src="https://cdn.jsdelivr.net/npm/video.js@7.5.0/dist/video.min.js"></script><script src="https://cdn.jsdelivr.net/npm/videojs-youtube@2.6.1/dist/Youtube.min.js"></script><script src="temp2.js"></script></body></html>
